import './App.css';
import React from "react";
import data from './data.js';
import Card from './components/Card';

function App({props}: any): any {
  const template = data.map(item => {
    return (
      <Card
        key={item.id}
        item={item}
      />
    )
  })

  return (
    <>
      <h1>hello</h1>
      <section>{template}</section>
    </>

  );
}

export default App;
